class BookFrame(tk.Frame):
    def __init__(self, master=None, book_class=None, home=None):
        super().__init__(master)
        self['width'] = master.cget('width')
        self['height'] = master.cget('height')
        self.C = Colors()
        self['bg'] = self.C.root_bg
        self.master = master
        self.home = home
